import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
// import Cards from './components/Cards';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Memories from './components/pages/Memories';
import Story from './components/pages/Story';
import Tokens from './components/pages/Tokens';
import Nashe from './components/pages/Nashe';
import Dates from './components/pages/Dates';
import Bts from './components/pages/Bts';
import timelineElements from "./timelineElements";
import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";
import { ReactComponent as WorkIcon } from "./images/star-2.svg";
import { ReactComponent as SchoolIcon } from "./images/star-2.svg";


function App() {
  let workIconStyles = { background: "#06D6A0" };
  let schoolIconStyles = { background: "#f9c74f" };
  return (
    <>
    <Router>
      <Navbar />
      <Switch>
        <Route path='/home' exact component={Home} />
        <Route path='/memories' component={Memories} />
        <Route path='/ourstory' component={Story} />
        <Route path='/tokens' component={Tokens} />
        <Route path='/nashe' component={Nashe} />
        <Route path='/dates' component={Dates} />
        <Route path='/bts' component={Bts} />
      </Switch>
      <Footer/>
    </Router>
    <VerticalTimeline>
    {timelineElements.map((element) => {
          let isWorkIcon = element.icon === "work";
          let showButton =
            element.buttonText !== undefined &&
            element.buttonText !== null &&
            element.buttonText !== "";

          return (
            <VerticalTimelineElement
              key={element.key}
              date={element.date}
              dateClassName="date"
              iconStyle={isWorkIcon ? workIconStyles : schoolIconStyles}
              icon={isWorkIcon ? <WorkIcon /> : <SchoolIcon />}
            >
              <h3 className="vertical-timeline-element-title">
                {element.title}
              </h3>
              <h5 className="vertical-timeline-element-subtitle">
                {element.location}
              </h5>
              <p id="description">{element.description}</p>
              {showButton && (
                <a
                  className={`button ${
                    isWorkIcon ? "workButton" : "schoolButton"
                  }`}
                  href="/"
                >
                  {element.buttonText}
                </a>
              )}
            </VerticalTimelineElement>
          );
        })}
    </VerticalTimeline>
  </>
  );
}

export default App;
